import React from 'react';
import { useSelector } from 'react-redux';

export const TodoList=()=>{
    const [data,setData]=React.useState({});
    const getData=()=>{
        fetch('http://localhost:8080/store')
        .then((res)=>res.json())
        .then((res)=>setData(res))
    }
    React.useEffect(()=>getData,[data])

    return(
        <>
            {data.map((e)=>(
                <p>{e.title}</p>
            ))}
        </>
    )


}
